import React from 'react';

function Menu(){
    return(
        <div className="menu container">
        <div className="row">
            <div className="col-lg-4 col-sm-6 col-md-6">
                <div className="title"><h3>Categories</h3></div>
                <a href="http://">Most Selling</a>
                <a href="http://">Sauces</a>
                <a href="http://">Beef Burger</a>
                <a href="http://">Little Bites</a>
                <a href="http://">Side Items</a>
                <a href="http://">Beverages</a>
            </div>
        </div>
        </div>
    );
}

export default Menu;
